import React from "react";
import { Container, Header, Footer, Sidebar } from "../components/layout/layout";
import { Button, Card, Modal } from "../components/ui/ui";
import { DynamicForm, Field, formUtils } from "../components/forms";

function App() {    
    return (

        <div className="wrapper">
            <Header/>
            <Footer/>
            <Sidebar/>
            <Container/>
        </div>
    );
}
export default App;
